●Bluetooth搭載のスマートフォン/携帯電話にワイヤレス接続（リンク）できるハンズフリーヘッドセットです。<br>●音声がクリアで、通信性能・省電力性能に優れたBluetooth規格ver.4.1を採用。<br>●マルチポイント接続に対応。2台のBluetooth搭載携帯電話を同時に待ち受け可能です。<br>●1マイクCVCノイズキャンセリング機能搭載で、送信/受信の双方のノイズを軽減します。<br>●手軽で耳にやさしいインイヤータイプ。2種類のイヤーピースを同梱しており、耳に合わせて交換できます。<br>●A2DP（SCMS-T）対応で音楽やワンセグの音声出力も楽しめます。<br>●接続完了や電源ON/OFFなどを音声で案内。<br>●脱落予防のイヤーフックを付属。左右どちらの耳にも装着可能です。<br>●メインスイッチ1回押しの簡単操作で着信応答・終話が可能。<br>●ラストナンバーリダイヤルも可能。<br>●使いやすい2ボタン式（プラス/マイナス）のボリューム調節機能付き。<br><br>品番：BT740<br>メーカー：セイワSEIWA<style type="text/css">
