●Bluetooth搭載のスマートフォン/携帯電話にワイヤレス接続（リンク）できるハンズフリーヘッドセットです。<br>●装着しているのを忘れるほどの軽さ、わずか約5グラム。<br>●通信性能・省電力性能に優れたBluetooth規格ver.3.0を採用。<br>●手軽で耳にやさしいインイヤータイプ。2種類のイヤーピースを同梱しており、耳に合わせて交換できます。<br>●iPhoneの画面上ステータスバーに電池残量アイコンを表示（写真A参照）。<br>対応機種： iPhone6/6Plus/5s/5c/5/4s/4/3GS/3G（iOS3.12以降 ※2015年7月現在）。<br>●脱落予防のイヤーフックを付属。左右どちらの耳にも装着可能。<br>●スイッチが1つだけの簡単シンプルな操作。<br>●メインスイッチ1回押しの簡単操作で着信応答・終話が可能。<br>●ラストナンバーリダイヤルも可能。<br>●お車のアクセサリーソケットから充電できるDC充電器を付属。DC12V/24V車専用です（マイナスアース車に限る）。<br>●パソコンなどで充電できるUSB充電ケーブルを付属。<br><br>品番：BT730<br>メーカー：セイワSEIWA<style type="text/css">
