●Bluetooth搭載のスマートフォン/携帯電話にワイヤレス接続（リンク）できるハンズフリーイヤホンです。<br>●車内でのご使用に便利な充電用ホルダー付きです。ホルダーにイヤホンをセットするだけで充電ができます。着信時はホルダーからイヤホンを外すだけで着信を受けられます。<br>●HDボイス対応。音声がクリアで、通信性能・省電力性能に優れたBluetooth規格ver.4.1を採用。<br>●マルチポイント接続に対応。2台のBluetooth搭載携帯電話を同時に待ち受け可能です。<br>●1マイクCVCノイズキャンセリング機能搭載で、送信/受信の双方のノイズを軽減します。<br>●周囲の環境騒音に強いカナルタイプ。S/M/Lの3種類のイヤーピースを同梱しており、耳に合わせて交換できます。<br>●A2DP（SCMS-T）対応で音楽やワンセグの音声出力も楽しめます。<br><br>品番：BT800<br>メーカー：セイワSEIWA<style type="text/css">
