●Bluetoothを搭載した携帯電話と、ワイヤレスで通話ができ、音楽/ワンセグ音声が聴けます。<br><br>●Bluetoothバージョン4.1仕様。（従来のバージョンとも互換性があり、従来のバージョンの携帯電話でも使用できます。）<br><br>●AVRCP対応でリモコン機能が使えます。（再生/一時停止/音量UP/音量DOWN/曲送り/曲戻し）<br><br>●耳穴にあわせて変えられるイヤホンパッドXS/S/Mサイズ付。<br><br>●シリコンゴム製の右用・左用耳フック付き。柔らかい素材で、耳の溝に引っ掛けることによりフィットします。<br><br>●長時間装着も快適。軽量15g、絡みにくいフラットケーブル採用。<br><br>●マグネット付きイヤホンで首に掛けられて、持ち運びにも便利。<br><br>●iPhoneの液晶画面にBluetoothヘッドセットの電池残量が表示。<br><br>*本製品の充電は、USB端子のあるパソコン、またはUSB充電器が必要です。<br><br><br><br>【仕様】<br>音楽再生時間：最大約5時間<br>充電時間：約1.5時間<br>本体コード長/重量：約50cm/約15g<br>USBケーブル長：約25cm<br><br>メーカー：カシムラ<br> 品番：BL-60<style type="text/css">
