●Bluetooth搭載のスマートフォン/携帯電話にワイヤレス接続（リンク）できるハンズフリーヘッドセットです。<br>●車内や卓上での使用に便利なマグネット充電用スタンド付きです。スタンドにヘッドセットをセットするだけで充電ができます。着信時はクレードルからヘッドセットを外すだけで着信を受けられます。<br>●音声がクリアで、通信性能・省電力性能に優れたBluetooth規格ver.4.1を採用。<br>●マルチポイント接続に対応。2台のBluetooth搭載携帯電話を同時に待ち受け可能です。<br>●1マイクCVCノイズキャンセリング機能搭載で、送信/受信の双方のノイズを軽減します。<br>●遮音性の高いカナルタイプ。3種類(S/M/L)のイヤーピースを同梱しており、耳に合わせて交換できます。<br><br>品番：BT790<br>メーカー：セイワSEIWA<style type="text/css">
